import './App.css';


class MusicBox extends Component {

    constructor(props) {
      super(props);
      this.state = {
        //repeater: null,
        speed: 50,
      }
    }

    render() {
        return(
            <div style={{position:"relative",width:"62px", height:"35px", overflow:"hidden", display:"hidden"}}>
                <div style={{position:"absolute",top:"-266px",left:"-5px"}}>    
                    <iframe width="300" height="300" src="https://www.youtube.com/embed/ahvxKn8s3f8" allowfullscreen></iframe>
                </div>
            </div>
        );
    }

}
export default MusicBox;
